import React from 'react'

const Banner = () => {
  return (
    <div>
        <div aria-multiselectable>
            <img src="https://images.unsplash.com/photo-1503428593586-e225b39bddfe?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D" alt="" />
            <div className='e-p-overlay'>

            </div>
        </div>
    </div>
  )
}

export default Banner
